import React from "react";

import { Container } from "@material-ui/core";

import useStyles from "./styles";
import Navbar from "./components/Navbar/Navbar";
import Home from "./components/Home/Home";
import Auth from "./components/Auth/Auth";
import { Cart } from "./components/Carts/Carts";
import { BrowserRouter, Switch, Route, Redirect } from "react-router-dom";
// import memories from "./images/memories.png";
import { GoogleOAuthProvider } from "@react-oauth/google";

const App = () => {
  const classes = useStyles();

  return (
    <GoogleOAuthProvider clientId="239195074958-okbq7hhp43aonq5lkcb04lqjasrmbc2t.apps.googleusercontent.com">
      <BrowserRouter>
        <Container maxWidth="lg">
          <Navbar />
          <Switch>
            <Route
              path="/"
              exact
              component={() => <Redirect to="/products" />}
            />
            <Route path="/products" exact component={Home} />
            <Route path="/auth" exact component={Auth} />
            <Route path="/myCart" exact component={Cart} />
          </Switch>
        </Container>
      </BrowserRouter>
    </GoogleOAuthProvider>
  );
};

export default App;
